sample: '["\"Technik, (Retro-)Videospiele, Filme und Musik. Und nat\u00fcrlich alles,
  was mit Android und der Netzwelt zu tun hat.\\nKurzportrait\\nMartin, geb\u00fcrtiger
  M\u00fcnchner, ist schon von Kindesbeinen an mit Technik vertraut. Den Beginn machte
  der AMIGA 500, auf dem die beiden Monkey Island-Teile rauf und runter liefen. Nach
  dem Tod von Commodore widmete er sich Konsolen (NES, Sega Mega Drive) und einem
  PC mit 133 MHz.\\nEines seiner ersten Handys war das Nokia 3410, das er sich hei\u00df
  ersehnt zum Geburtstag w\u00fcnschte. Sein erstes, richtiges Smartphone war das
  Palm Pre. Zu Android wechselte er, nachdem das Ende der \u00c4ra von Palm besiegelt
  war und holte sich ein Sony Xperia Pro. Seitdem blieb er Android treu und auch auf
  seinem Rechner l\u00e4uft ein Linux-System: Ubuntu.\\nZu GIGA kam er im Sommer 2013
  und gab seinen Job im Einzelhandel f\u00fcr das Ressort Android auf. Daf\u00fcr
  folgte ein Wohnortwechsel von M\u00fcnchen nach Berlin. Zuvor arbeitete er bei kleineren
  Online-Magazinen, in denen er erste Erfahrungen sammeln konnte.\\nAuf vielen Smartphones
  befinden sich heutzutage Unmengen von privaten und kritischen Daten, welche auf
  gar keinen Fall in falsche H\u00e4nde geraten sollten. F\u00fcr mehr Sicherheit
  und Datenschutz sorgt die App \u201eSRT AppGuard\u201c, welche die Kontrolle \u00fcber
  die App-Berechtigungen...\\nZwar war es in den letzten Monaten etwas ruhig um das
  Custom-ROMParanoid Android, das hei\u00dft aber nicht, dass es von der Bildfl\u00e4che
  verschwunden ist. Stattdessen haben die Entwickler im stillen K\u00e4mmerlein fleissig
  an einer neuen Alpha gearbeitet, die auf Android...\\nMit dem LG G Flex 2 pr\u00e4sentiert
  uns der s\u00fcdkoreanische Hersteller LG nicht nur sein gebogenes Smartphones mit
  einem Full HD-Bildschirm, sondern liefert auch zur P-OLED-Displayeinheit passende
  Wallpaper, die die kr\u00e4ftigen Farben des Bildschirms untermalen sollen...\\nZwar
  kann das LG G Flex 2 zwar noch nicht in Deutschland gekauft werden, das hei\u00dft
  aber nicht, dass wir euch die Hintergrundbilder des in der Querachse gebogenen Smartphones
  vorenthalten m\u00f6chten. In diesem Artikel bieten wir Bild f\u00fcr Bild zur Ansicht
  und zum...\\nBis dato war es nicht mal \u00fcber Umwege m\u00f6glich, WhatsApp Web
  in Mozilla Firefox zu nutzen. Zwar erscheint nach wie vor beim \u201enormalen\u201c
  WhatsApp Web-Besuch mit dem Firefox der Hinweis, Googles Chrome sei erforderlich,
  die Kompatibilit\u00e4t scheint jedoch gegeben...\\nZwar scheint die Partnerschaft
  zwischen der Cyanogen Inc. und OnePlus nicht gerade rosig zu verlaufen, nichtsdestotrotz
  wird das im Januar gegebene Versprechen, das OnePlus One im Februar mit dem Update
  auf die CyanogenMod-Version 12S zu versorgen, die auf Android...\\nDie Ger\u00fcchtek\u00fcche
  um das Huawei Ascend P8 brodelt bereits seit einiger Zeit, in fr\u00fcheren Spekulationen
  wurde mit einer Pr\u00e4sentation des Flaggschiffs auf der CES in Las Vegas gerechnet.
  Gegen\u00fcber der Website Pocket-Lint \u00e4u\u00dferte Huaweis Director of Marketing...\\nMit
  der minimalistischen und im modernen Material Design gestalteten Textverarbeitungs-App
  JotterPad 11 lassen sich auf Android-Ger\u00e4ten schnell und einfach Texte erstellen
  und bearbeiten. Wir haben einen genaueren Blick auf die App geworfen.\\nJotterPad
  ist eine Textverarbeitungs-App f\u00fcr Android, die gegen\u00fcber den meisten
  Alternativen recht umfangreich ausgestattet ist. Die Basisversion bringt zwar ein
  W\u00f6rterbuch mit Wortvorschl\u00e4gen mit sich \u2014 leider jedoch ausschlie\u00dflich
  auf Englisch, auch die...\\nVor knapp drei Wochen sind die ersten Nightly-Builds
  von der Custom-ROM CyanogenMod in Version 12, basierend auf Android 5.0 Lollipop,
  ver\u00f6ffentlicht worden. Diese werden sukzessive um alte und neue Funktionen
  erweitert \u2013 seit gestern hat das CM-Team neue Wallpaper...\\nSamsung und Apple
  werden nicht zu Unrecht als die beiden Giganten im Smartphone-Sektor gehandelt.
  Im vierten Quartal lagen beide Tech-Riesen nun gleichauf, die Konzerne machten jeweils
  20 Prozent der gesamten Smartphone-Verk\u00e4ufe aus.\\nEinem polnischen Blog zufolge
  kann das Samsung Galaxy S6 mit Erweiterungs-Backcovern ausgestattet werden. So soll
  es nicht nur m\u00f6glich sein, das s\u00fcdkoreanische Flaggschiff zum YotaPhone
  2 nachzur\u00fcsten, sondern auch gesundheitliche Aspekte w\u00fcrden mit den Backcovern...\\nAuch
  das chinesische Unternehmen Meizu stattet Mini-Versionen seiner Flaggschiffe mit
  Mini-Spezifikationen aus. So siedelt sich das nun pr\u00e4sentierte Meizu M1 Note
  Mini \u2013 ganz im Gegensatz zu seinem High-End-Pendant \u2013 im Mittelklasse-Sektor
  an. Nichtsdestotrotz...\\nDas Meizu M1 Note Mini ist \u2014 zumindest vom Namen
  her \u2014 der kleine Bruder des Meizu M1 Note, hat jedoch bis auf die Optik nicht
  viel mit dem High-End-Phablet mit einem in der 5,5 Zoll in der Diagonale messenden
  Display gemein. Die Spezifikationen siedeln sich im...\\nDie Ger\u00fcchtek\u00fcche
  um das HTC One (M9) brodelt: Neben verschiedenen Spekulationen zum Design und mutma\u00dflichen
  Fotos des kommenden HTC-Flaggschiffs ist nun auch ein Benchmark-Ergebnis in der
  Geekbench-Datenbank aufgetaucht. Im Vergleich zu einem ebenfalls aktuell...\\nAuf
  der CES 2015 bekamen wir nicht nur so manches Smartphone und Tablet zu Gesicht,
  sondern auch verschiedene Gadgets, wie den Green Lantern Ring, der myBrain Melomind
  Gehirnstrommessung, smarten Gl\u00fchbirnen von Sengled sowie einem Tennis- und
  Golftrainings-Wearables...\\nLange Zeit blieb es still in Sachen Ger\u00fcchte zum
  n\u00e4chsten Huawei-Flaggschiff. Diese d\u00fcrften mit der Einladung zu einem
  Event am 1. M\u00e4rz im Zuge des Mobile World Congress in Barcelona erneut angeheizt
  werden. Zuletzt war ein Huawei Ascend P8 im Gespr\u00e4ch, das...\\nZum Start der
  CyanogenMod 12 Nightly-Builds f\u00fcr Sony-Tablets und -Smartphones wurden nur
  Ger\u00e4te bis zum Xperia Z2 gegeben, nun wurde die CM-Version auf Basis von Android
  5.0 Lollipop auch f\u00fcr das Sony Xperia Z3, dem Sony Xperia Z3 Tablet Compact
  (LTE) und...\\nMit der App Imagine, die mit Basisfunktion kostenlos ist, bekommt
  man nicht nur einen Instagram-Client mit Material Design, sondern auch einen Querformat-Modus,
  der sich insbesondere bei Tablets praktisch erweist. Die App ist werbefrei und bekommt
  im Play Store...\\nNachdem wir gestern einen relativ unspektakul\u00e4ren und unglaubw\u00fcrdigen
  Leak des HTC One M9 (Hima) zu Gesicht bekommen haben, ist das kommende Flaggschiff
  nun auf glaubw\u00fcrdigeren Fotos aus einer vertrauensw\u00fcrdigeren Quelle aufgetaucht.
  Sie zeigen erneut, dass...\\nDer Suchmaschinenriese Google speichert nicht nur die
  eingegebenen Suchanfragen, sondern auch die mit dem Android-Ger\u00e4t bei Google
  Now get\u00e4tigten Audio-Eingaben. Diese h\u00e4lt der Internetriese nicht unter
  Verschluss, sondern gibt jedem Nutzer die M\u00f6glichkeit...\\nHP stellt mit dem
  Pro Slate 8 und Pro Pro 12 zwei solide Tablets vor, die sich im oberen Mittelklasse-Bereich
  ansiedeln. Einen zus\u00e4tzlichen Kaufanreiz soll der HP Duet Pen schaffen, der
  auf eine Qualcomm-Technologie zur\u00fcckgreift und mit dem Stylus erstellte...\\nBei
  dem HP Pro Slate 8 und 12 handelt es sich um Mittelklasse-Tablets mit einem 4:3-Seitenverh\u00e4ltnis.
