  aus der Literatur\\nF\u00f6rderung von Selbstwirksamkeit und eines positiven Selbstwertgef\u00fchls
  bei den Teilnehmerinnen\\nDie M\u00e4dchen haben h\u00e4ufig \u2013 nach jahrelanger
  Gewalterfahrung in der Familie sowie eigenen kriminellen Aktivit\u00e4ten und der
  Reaktionen darauf \u2013 ein \u00e4u\u00dferst negatives Bild von sich selbst, das
  als Ergebnis von Zuschreibungsprozessen gedeutet werden kann. Gerade deshalb ist
  die Arbeit an der Pers\u00f6nlichkeitsentwicklung der M\u00e4dchen im Rahmen des
  KAPM seit dessen Beginn im Jahr 2004 zunehmend wichtiger geworden. Vor allem die
  F\u00f6rderung eines gesunden Selbstwertgef\u00fchls, die Arbeit an der Selbstwirksamkeit
  sowie der realistischen Zielsetzung und realistischen Selbsteinsch\u00e4tzung stehen
  hierbei im Vordergrund. Die M\u00e4dchen bekommen w\u00e4hrend des Trainings h\u00e4ufig
  wieder ein besseres Gesp\u00fcr daf\u00fcr, welche F\u00e4higkeiten eigentlich in
  ihnen stecken. Erst darauf aufbauend k\u00f6nnen sie dann die Erkenntnis entwickeln,
  dass es M\u00f6glichkeiten f\u00fcr sie gibt, neue Wege einzuschlagen.\\nBeschreibung
  der Aktivit\u00e4t\\nGruppenarbeit des K\u00f6lner Antigewaltprogramms f\u00fcr
  M\u00e4dchen\\nAuf den Grundz\u00fcgen des klassischen AAT basierend ist es ein
  delikt- und defizitspezifisches sozialp\u00e4dagogisch-psychologisches Angebot,
  das dem Prinzip folgt: Achtung und Wertsch\u00e4tzung der Pers\u00f6nlichkeit der
  Jugendlichen bei gleichzeitiger Verurteilung ihrer Gewaltbereitschaft.\\nDeutschland\\nM\u00e4dchen
  zwischen 14 und 21 Jahre alt\\nEvaluierung der Aktivit\u00e4t\\nDie Durchf\u00fchrung
  des Forschungsvorhabens erfolgte in zwei Phasen. In der ersten Phase (Modellierungsphase)
  wurden gemeinsam mit p\u00e4dagogischen Fachkr\u00e4ften Logische Modelle ihrer
  jeweiligen kriminalpr\u00e4ventiven Projektpraxis angefertigt. Diese Modellierung
  erfolgte in Form von regelm\u00e4\u00dfigen Projektbesuchen in einem diskursiven
  Verfahren zwischen den Evaluatorinnen und den Projektmitarbeiterinnen. In der zweiten
  Phase (zwischen Januar 2010 und Oktober 2010) wurde eine Wirkungsevaluation durchgef\u00fchrt,
  in der \u00fcberpr\u00fcft wurde, inwieweit bei der Zielgruppe des Antigewaltprogramms
  die intendierten Resultate erreicht wurden. Die Wirkungsevaluation besteht zum einen
  aus einer Einsch\u00e4tzung der Wirkungen durch Programm-Teilnehmerinnen nach Beendigung
  des KAPM und zum anderen aus einer Vorher-Nachher-Messung anhand eines standardisierten
  Fragebogens.\\nJanuar 2009 bis Dezember 2010\\nDeutschland\\nForschungsbericht\\nHausmann,
  Berit (2011): Evaluation des K\u00f6lner Antigewaltprogramms f\u00fcr M\u00e4dchen
  (KAPM). Bericht im Rahmen des Projektmoduls \u201eDas Logische Modell als Instrument
  der Evaluation in der Kinder- und Jugendkriminalit\u00e4tspr\u00e4vention\u201c
  der Arbeitsstelle Kinder- und Jugendkriminalit\u00e4tspr\u00e4vention. Deutsches
  Jugendinstitut\\nWU-Bibliothekskatalog\\nWU-Bibliothekskatalog\"", "\"Anspruchsvolle
  Ausbildung mit guten Karrierechancen\\nSeit November 2021 engagieren sich neue Teilnehmer,
  die sich als Verkaufstrainer mithilfe eines starken Kooperationspartners selbstst\u00e4ndig
  machen wollen, mit Leidenschaft und Herzblut in der INtem\u00ae-Verkaufstrainerausbildung.
  \u201eDie Ausbildung ist anspruchsvoll\u201c, meint Helmut Se\u00dfler, \u201eaber
  alle Teilnehmer sind mit Enthusiasmus bei der Sache. Denn sie wissen, dass es sich
  lohnt, sich zum Verkaufstrainer ausbilden zu lassen, ihre beruflichen Zukunftsaussichten
  sind mehr als positiv \u2013 gerade jetzt.\u201c\\nBoomender Verkaufstrainermarkt\\nDabei
  decken die Richtungen, in die die Verkaufstrainer nach der Gr\u00fcndung ihrer selbstst\u00e4ndigen
  Existenz loslaufen wollen, sehr unterschiedliche Bereiche ab. \u201eDas liegt daran,
  dass der Verkaufstrainermarkt boomt, weil viele Unternehmen Nachholbedarf haben\u201c,
  f\u00fchrt Carsten Kutzner aus. \u201eGerne haben wir als Traineranw\u00e4rter Pers\u00f6nlichkeiten,
  mit einem vertrieblichen Background und aus unterschiedlichen Branchen\u201c. Nach
  der Ausbildung verf\u00fcgen die Verkaufstrainer \u00fcber mehrere professionelle
  Trainingskonzepte und eine Methode, mit der sie ihren Teilnehmern direkt ihr Wissen
  nachhaltig vermitteln k\u00f6nnen.\\nTesting mit Qualit\u00e4tsnachweis\\nDie neuen
  Trainer durften Anfang M\u00e4rz im Rahmen der Ausbildung auch Ihr Testing zum \u201eakkreditierten
  INtem\u00ae-Verkaufstrainer\u201c, \u201egepr\u00fcften Verkaufstrainer BDVT\u201c
  des Berufsverbandes und \u201eCertified Trainer Sales Management\u201c in Kooperation
  mit der Hochschule der Wirtschaft f\u00fcr Management ablegen. Wieder einmal konnten
  alle Teilnehmer ihre Qualifizierung eindrucksvoll unter Beweis stellen.\\nAusbildung
  mit h\u00f6chster Qualit\u00e4t und freie Wahl\\nEgal ob 3, 15 oder 21 Tage Ausbildung
  jeweils in 3-Tagesbl\u00f6cken, die Unterst\u00fctzung der INtem\u00ae-Experten
  ist allen Absolventen der Trainerausbildungen gewiss.\\nDas Besondere: Zwischen
  den Modulen liegen mehrw\u00f6chige Umsetzungsphasen, in denen das neue Know-how
  direkt angewendet wird. Dabei gelingt es nicht selten, mit der Unterst\u00fctzung
  des Kooperationspartners bereits w\u00e4hrend der Ausbildung die ersten Kunden zu
  akquirieren.\\nDabei entscheiden die Teilnehmer individuell, wie viel Unterst\u00fctzung
  sie in Anspruch nehmen m\u00f6chten. \u201eDie meisten agieren selbstst\u00e4ndig,
  manche nutzen die Verkaufstrainings als zweites Standbein oder als firmeninterne
  Mitarbeiter\u201c, freut sich Carsten Kutzner, Gesch\u00e4ftsf\u00fchrer von INtem\u00ae\"",
