  in der aktuell g\u00fcltigen Fl\u00e4chenkulisse des EEG 2017.\\nWas kostet eine
  Freifl\u00e4chenanlage?\\nDie Kosten der Solaranlagen (mindestens 40 bis 500 Kilowattpeak)
  beziffern sich im Durchschnitt auf 1350 Euro pro Kilowattpeak \u2013 inklusive der
  Montageleistung. Diese Kosten setzen sich aus verschiedenen Faktoren zusammen: Kosten
  des Erwerbs der PV-Freilandanlage. Was kostet eine Freifl\u00e4chen Photovoltaik?
  Generell gilt, je gr\u00f6\u00dfer die Anlage desto g\u00fcnstiger ist im Verh\u00e4ltnis
  der Preis. F\u00fcr gr\u00f6\u00dfere Solaranlagen ab 40 bis maximal 500 Kilowatt
  peak kann von einem Anschaffungspreis von 1.350 Euro pro Kilowatt peak ausgegangen
  werden. In diesem Preis ist die Montage in der Regel bereits enthalten.\\nWie viel
  verdient man mit einem Solarpark?\\nSie k\u00f6nnen pro Jahr und Hektar bis 4900
  Euro verdienen, abh\u00e4ngig von der Lage der Fl\u00e4che und vom Projekt. Beispiel:
  5 Megawatt Solarpark in Saarland, n\u00f6tige Fl\u00e4che 5 Hektar, j\u00e4hrliche
  Pacht 15.000 Euro, pro Hektar und Jahr 3.000 Euro. Was verdient man mit einem Solarpark?
  F\u00fcr Januar 2020 liegt die Einspeiseverg\u00fctung f\u00fcr Solar-Anlagen bei
  einer H\u00f6chstleistung der Anlage von bis zu zehn Kilowattpeak bei 9,87 Cent
  pro Kilowattstunde \u00fcber die n\u00e4chsten 20 Jahre. Das sind rund 14 Prozent
  weniger als im Vorjahr, wie aus Daten der Bundesnetzagentur hervorgeht.\\nWie viel
