  Ertrag als Dachanlagen. Pro Hektar Fl\u00e4che erzeugt eine solche Anlage j\u00e4hrlich
  etwa 400.000 bis 500.000 Kilowattstunden Strom.\\nWie viel kWh ist ein kWp?\\nEine
  1 kWp Photovoltaikanlage mit Standort in Deutschland kann im Durchschnitt etwa 1.000
  kWh j\u00e4hrlich erzeugen. Allerdings wird der Strom nicht immer dann erzeugt,
